    public int lengthOfLongestSubstring(String s) {
        //////////////
        //attempted//
        /////////////
        int oldMaxLength = 0;
        int baseIndex = 0;
        int currentLentgth = 1;
        char currentSymbol;
        String tmp;
        int currentIndex = 1;
        //going throw the string
        while (currentIndex < s.length()) {
            currentSymbol = s.charAt(currentIndex);
            // our tmp is like a train - we try to add any new symbol to the tmp-string if it not contain and
            // cut the head of tmp-string in another case
            tmp = s.substring(baseIndex, currentIndex);
            currentLentgth = tmp.length();
            if (tmp.contains(String.valueOf(currentSymbol))) {
                while (tmp.contains(String.valueOf(currentSymbol))) {
                    baseIndex++;
                    tmp = tmp.substring(1);
                }
                // recalc length
                oldMaxLength = oldMaxLength < currentLentgth ? currentLentgth : oldMaxLength;
                currentIndex++;
                currentLentgth = tmp.length();
                continue;
            } else {
                //or our train is grows
                currentIndex++;
                currentLentgth = currentIndex - baseIndex;
            }
        }
        oldMaxLength = oldMaxLength < currentLentgth ? currentLentgth : oldMaxLength;
        return oldMaxLength;
    }
